dw1 =  (2*c3^3*f2*mv^2 + 2*f2*g3^3*m1^2 + 2*f2*h3^3*m2^2 + 2*c3^2*mv^2*ta1 + 2*g3^2*m1^2*ta1 + 2*h3^2*m2^2*ta1 + 2*Icv22*m1*ta1 + 2*Icv22*m2*ta1 + Ip11*m1*ta1 + Ip11*m2*ta1 + Ip22*m1*ta1 + Ip22*m2*ta1 + Iq11*m1*ta1 + Iq11*m2*ta1 + Iq22*m1*ta1 + Iq22*m2*ta1 + 2*Icv22*mv*ta1 + Ip11*mv*ta1 + Ip22*mv*ta1 + Iq11*mv*ta1 + Iq22*mv*ta1 + Ip11^2*m1*x(13)*x(8) + Ip11^2*m2*x(13)*x(8) + Ip22^2*m1*x(13)*x(8) + Ip22^2*m2*x(13)*x(8) + Ip11^2*mv*x(13)*x(8) + Ip22^2*mv*x(13)*x(8) + Iq11^2*m1*x(15)*x(8) + Iq11^2*m2*x(15)*x(8) + Iq22^2*m1*x(15)*x(8) + Iq22^2*m2*x(15)*x(8) + Iq11^2*mv*x(15)*x(8) + Iq22^2*mv*x(15)*x(8) + 2*Icv22^2*m1*x(8)*x(9) + 2*Icv22^2*m2*x(8)*x(9) + Ip11^2*m1*x(8)*x(9) + Ip11^2*m2*x(8)*x(9) + Ip22^2*m1*x(8)*x(9) + Ip22^2*m2*x(8)*x(9) + Iq11^2*m1*x(8)*x(9) + Iq11^2*m2*x(8)*x(9) + Iq22^2*m1*x(8)*x(9) + Iq22^2*m2*x(8)*x(9) + 2*Icv22^2*mv*x(8)*x(9) + Ip11^2*mv*x(8)*x(9) + Ip22^2*mv*x(8)*x(9) + Iq11^2*mv*x(8)*x(9) + Iq22^2*mv*x(8)*x(9) + 2*c3^2*m1*mv*ta1 + 2*c3^2*m2*mv*ta1 + 2*g3^2*m1*m2*ta1 + 2*g3^2*m1*mv*ta1 + 2*h3^2*m1*m2*ta1 + 2*h3^2*m2*mv*ta1 - Ip11*m1*ta1*cos(2*x(14)) - Ip11*m2*ta1*cos(2*x(14)) + Ip22*m1*ta1*cos(2*x(14)) + Ip22*m2*ta1*cos(2*x(14)) - Ip11*mv*ta1*cos(2*x(14)) + Ip22*mv*ta1*cos(2*x(14)) - Iq11*m1*ta1*cos(2*x(16)) - Iq11*m2*ta1*cos(2*x(16)) + Iq22*m1*ta1*cos(2*x(16)) + Iq22*m2*ta1*cos(2*x(16)) - Iq11*mv*ta1*cos(2*x(16)) + Iq22*mv*ta1*cos(2*x(16)) - Ip11*m1*ta2*sin(2*x(14)) - Ip11*m2*ta2*sin(2*x(14)) + Ip22*m1*ta2*sin(2*x(14)) + Ip22*m2*ta2*sin(2*x(14)) - Ip11*mv*ta2*sin(2*x(14)) + Ip22*mv*ta2*sin(2*x(14)) - Iq11*m1*ta2*sin(2*x(16)) - Iq11*m2*ta2*sin(2*x(16)) + Iq22*m1*ta2*sin(2*x(16)) + Iq22*m2*ta2*sin(2*x(16)) - Iq11*mv*ta2*sin(2*x(16)) + Iq22*mv*ta2*sin(2*x(16)) + 2*c3^3*mv^3*x(12)*x(7) + 2*c3^4*mv^3*x(8)*x(9) + 2*g3^3*m1^3*x(12)*x(7) + 2*Icv22*c3*f2*mv + 2*h3^3*m2^3*x(12)*x(7) + Ip11*c3*f2*mv + Ip22*c3*f2*mv + Iq11*c3*f2*mv + Iq22*c3*f2*mv + 2*g3^4*m1^3*x(8)*x(9) + 2*h3^4*m2^3*x(8)*x(9) + 2*Icv22*f2*g3*m1 + Ip11*f2*g3*m1 + Ip22*f2*g3*m1 + Iq11*f2*g3*m1 + Iq22*f2*g3*m1 + 2*Icv22*f2*h3*m2 + Ip11*f2*h3*m2 + Ip22*f2*h3*m2 + Iq11*f2*h3*m2 + Iq22*f2*h3*m2 - Ip11*c3*f2*mv*cos(2*x(14)) + Ip22*c3*f2*mv*cos(2*x(14)) - Ip11*f2*g3*m1*cos(2*x(14)) + Ip22*f2*g3*m1*cos(2*x(14)) - Ip11*f2*h3*m2*cos(2*x(14)) + Ip22*f2*h3*m2*cos(2*x(14)) - Iq11*c3*f2*mv*cos(2*x(16)) + Iq22*c3*f2*mv*cos(2*x(16)) + Ip11*c3*f1*mv*sin(2*x(14)) - Ip22*c3*f1*mv*sin(2*x(14)) - Iq11*f2*g3*m1*cos(2*x(16)) + Iq22*f2*g3*m1*cos(2*x(16)) - Iq11*f2*h3*m2*cos(2*x(16)) + Iq22*f2*h3*m2*cos(2*x(16)) + Ip11*f1*g3*m1*sin(2*x(14)) - Ip22*f1*g3*m1*sin(2*x(14)) + Ip11*f1*h3*m2*sin(2*x(14)) - Ip22*f1*h3*m2*sin(2*x(14)) - 2*Ip33*c3^2*mv^2*x(13)*x(8) - 2*Iq33*c3^2*mv^2*x(15)*x(8) - 2*Ip33*g3^2*m1^2*x(13)*x(8) - 2*Ip33*h3^2*m2^2*x(13)*x(8) - 2*Iq33*g3^2*m1^2*x(15)*x(8) - 2*Iq33*h3^2*m2^2*x(15)*x(8) + Iq11*c3*f1*mv*sin(2*x(16)) - Iq22*c3*f1*mv*sin(2*x(16)) + 4*Icv22*c3^2*mv^2*x(8)*x(9) - 2*Icv33*c3^2*mv^2*x(8)*x(9) + 2*Ip11*c3^2*mv^2*x(8)*x(9) + 2*Ip22*c3^2*mv^2*x(8)*x(9) - 2*Ip33*c3^2*mv^2*x(8)*x(9) + 2*Iq11*c3^2*mv^2*x(8)*x(9) + 2*Iq22*c3^2*mv^2*x(8)*x(9) - 2*Iq33*c3^2*mv^2*x(8)*x(9) + Iq11*f1*g3*m1*sin(2*x(16)) - Iq22*f1*g3*m1*sin(2*x(16)) + 4*Icv22*g3^2*m1^2*x(8)*x(9) - 2*Icv33*g3^2*m1^2*x(8)*x(9) + 2*Ip11*g3^2*m1^2*x(8)*x(9) + 2*Ip22*g3^2*m1^2*x(8)*x(9) - 2*Ip33*g3^2*m1^2*x(8)*x(9) + 2*Iq11*g3^2*m1^2*x(8)*x(9) + 2*Iq22*g3^2*m1^2*x(8)*x(9) - 2*Iq33*g3^2*m1^2*x(8)*x(9) + Iq11*f1*h3*m2*sin(2*x(16)) - Iq22*f1*h3*m2*sin(2*x(16)) + 4*Icv22*h3^2*m2^2*x(8)*x(9) - 2*Icv33*h3^2*m2^2*x(8)*x(9) + 2*Ip11*h3^2*m2^2*x(8)*x(9) + 2*Ip22*h3^2*m2^2*x(8)*x(9) - 2*Ip33*h3^2*m2^2*x(8)*x(9) + 2*Iq11*h3^2*m2^2*x(8)*x(9) + 2*Iq22*h3^2*m2^2*x(8)*x(9) - 2*Iq33*h3^2*m2^2*x(8)*x(9) - 2*Icv22*Ip33*m1*x(13)*x(8) - 2*Icv22*Ip33*m2*x(13)*x(8) - 2*Ip11*Ip22*m1*x(13)*x(8) - 2*Ip11*Ip22*m2*x(13)*x(8) - Ip11*Ip33*m1*x(13)*x(8) - Ip11*Ip33*m2*x(13)*x(8) - Ip22*Ip33*m1*x(13)*x(8) - Ip22*Ip33*m2*x(13)*x(8) - Ip33*Iq11*m1*x(13)*x(8) - Ip33*Iq11*m2*x(13)*x(8) - Ip33*Iq22*m1*x(13)*x(8) - Ip33*Iq22*m2*x(13)*x(